import React, { Component } from "react";
import Home from "./routes/Home.js";
import { HashRouter, Route } from "react-router-dom";

function App(){
    return(
    <HashRouter>
        <Route path="/" component={Home} exact />
    </HashRouter>
    )
}

export default App;
